// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';


function Header() {
  return (
    <header className="App-header">
    <ul style={{ listStyleType: "none" }}>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
    </ul>
    </header>
  );
}

export default Header;
